package tutorials;
import java.util.*;
public class NestedLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int i ;
		int j ;
		for (i = 1;i<6;i++)
		{
			for (j = 1 ; j< 11;j++)
			{
				System.out.print(" "+j);
			}
			System.out.println();
		}

	}

}
